import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import { Image } from 'react-bootstrap';

function Home() {
  return (
    <div className="App">
		<img src="logo.jpg" id="title"/>
			<p id="portfolio"><Link to='/places'>View Portfolio</Link></p>
    </div>
  );
}

export default Home;
